import '../Styles/Profile.modules.css';

interface Props {
    ProfileHandler: () => void;
}

function Profile({ProfileHandler} : Props) {
    return (
        <div style={{
            margin: 0,
            padding: 0,
            height: '20vh',
            background: "linear-gradient(to left, #3127A0 20%, white 80%);"}}>
            <div id="website-title">Website.com</div>
        </div>
    );
}

export default Profile;
